pragma solidity ^0.5.0;
import "../node_modules/@openzeppelin/contracts/ownership/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/ERC20Detailed.sol";

/// @title A house leasing contract
/// @author Jason Liu
/// @notice erer
/// @dev erer
contract RentalAgreement is ERC20, ERC20Detailed{
    struct HouseInfo{
        string physical_address;
        string city;
        uint zip_code;
        ///house_type indicate studio, two bedrooms, etc
        string house_type;
    }
    struct Deposit{
        uint amout;
        bool refunded;
        uint input_timestamp;
    }
    struct PaidRent{
        uint id;
        uint paid_timestamp;
        uint amount;
    }
    struct Termination{
        uint moveout_timestamp;
        string reason;
    }
    ///array that records rent payment
    PaidRent[] public paidrents;
    ///define contract state
    enum State {Created, Pending, Started, Terminated}
    State public status = State.Created;
    address public landlord;
    address public tenant;

}

